def test_calculate_similarity_example():
    assert calculate_similarity(model, 'test_good', 'test_evil') == pytest.approx(0.2059883560523423)

def test_find_most_similar_to_given_example():
    assert find_most_similar_to_given(model, 'test_bridge', ['test_car', 'test_man', 'test_arch']) == 'test_arch'

def test_doesnt_match_example():
    assert doesnt_match(model, ['test_homework', 'test_lunch', 'test_breakfast', 'test_dinner']) == 'test_homework'

test_model = {
        'left': [1, 0],
        'right': [-1, 0],
        'up': [0, 1],
        'down': [0, -1]
}

def test_calculate_similarity_same_word():
    assert calculate_similarity(test_model, 'left', 'left') == pytest.approx(1.0)

def test_calculate_similarity_opposite_word():
    assert calculate_similarity(test_model, 'left', 'right') == pytest.approx(-1.0)
    
def test_calculate_similarity_orthogonal_vectors():
    assert calculate_similarity(test_model, 'left', 'up') == pytest.approx(0.0)


